-- CONFIGURACIÓN
local CONFIG = {
    UseConsole = true,
    AutoCopy = true,
    ShowGUI = true
}

-- ============================================================================
-- VARIABLES GLOBALES
-- ============================================================================
local CapturedPayloads = {}
local DetectionStats = {
    loadstring_calls = 0,
    concat_calls = 0,
    char_calls = 0,
    bytecode_found = 0,
    source_found = 0
}

-- Referencias seguras a funciones originales
local real_loadstring = loadstring or load
local real_pcall = pcall
local real_string_char = string.char
local real_table_concat = table.concat
local real_getfenv = getfenv
local real_setfenv = setfenv

-- Verificar funciones disponibles
local has_setclipboard = (setclipboard ~= nil)
local has_writefile = (writefile ~= nil)
local has_game = pcall(function() return game end)

-- ============================================================================
-- SISTEMA DE LOGGING SIMPLIFICADO
-- ============================================================================
local function log(msg, level)
    level = level or "INFO"
    local text = string.format("[%s] %s", level, msg)
    if CONFIG.UseConsole then
        print(text)
    end
end

local function save_to_clipboard(content)
    if has_setclipboard then
        local success = pcall(function()
            setclipboard(content)
        end)
        if success then
            log("✅ Copiado al portapapeles", "SUCCESS")
            return true
        end
    end
    return false
end

-- ============================================================================
-- DETECTORES OPTIMIZADOS
-- ============================================================================
local function is_bytecode(str)
    if type(str) ~= "string" or #str < 4 then return false end
    return str:sub(1, 4) == "\27Lua" or str:sub(1, 3) == "LuaQ"
end

local function is_readable_code(str)
    if type(str) ~= "string" or #str < 100 then return false end
    
    local patterns = {
        "local%s+%w+%s*=",
        "function%s*%(",
        "return%s+",
        "if%s+.+%s+then",
        "game[%.:]",
        "script[%.:]"
    }
    
    local matches = 0
    for _, pattern in ipairs(patterns) do
        if str:match(pattern) then
            matches = matches + 1
            if matches >= 2 then return true end
        end
    end
    
    return false
end

local function analyze_payload(content)
    local size = #content
    local is_bc = is_bytecode(content)
    local is_src = is_readable_code(content)
    
    local confidence = 0
    if is_bc then confidence = 100 end
    if is_src then confidence = confidence + 80 end
    if size > 1000 then confidence = confidence + 10 end
    
    return {
        is_bytecode = is_bc,
        is_source = is_src,
        size = size,
        confidence = confidence
    }
end

-- ============================================================================
-- HOOKS OPTIMIZADOS
-- ============================================================================
local ProcessedHashes = {}

local function get_hash(str)
    return tostring(#str) .. tostring(str:sub(1, math.min(30, #str)))
end

local function process_payload(chunk, source_name)
    if type(chunk) ~= "string" or #chunk < 50 then return end
    
    local hash = get_hash(chunk)
    if ProcessedHashes[hash] then return end
    ProcessedHashes[hash] = true
    
    local analysis = analyze_payload(chunk)
    
    if analysis.confidence > 50 then
        log(string.format("🎯 %s: %d bytes, Confianza: %d%%", source_name, #chunk, analysis.confidence), "DETECT")
        
        table.insert(CapturedPayloads, {
            content = chunk,
            type = source_name,
            size = #chunk,
            is_bytecode = analysis.is_bytecode,
            is_source = analysis.is_source
        })
        
        if analysis.is_bytecode then
            DetectionStats.bytecode_found = DetectionStats.bytecode_found + 1
        elseif analysis.is_source then
            DetectionStats.source_found = DetectionStats.source_found + 1
        end
        
        return true
    end
    return false
end

-- Hook para loadstring
local function hook_loadstring(chunk, chunkname)
    DetectionStats.loadstring_calls = DetectionStats.loadstring_calls + 1
    process_payload(chunk, "loadstring")
    return real_loadstring(chunk, chunkname)
end

-- Hook para table.concat
local char_buffer = {}
local function hook_concat(tbl, sep, i, j)
    DetectionStats.concat_calls = DetectionStats.concat_calls + 1
    
    if type(tbl) == "table" and #tbl > 10 then
        local result = real_table_concat(tbl, sep, i, j)
        process_payload(result, "concat")
        return result
    end
    
    return real_table_concat(tbl, sep, i, j)
end

-- Hook para string.char
local function hook_char(...)
    DetectionStats.char_calls = DetectionStats.char_calls + 1
    local args = {...}
    
    if #args > 50 then
        for _, byte_val in ipairs(args) do
            table.insert(char_buffer, byte_val)
        end
        
        if #char_buffer > 500 then
            local assembled = real_string_char(unpack(char_buffer))
            process_payload(assembled, "string.char")
            char_buffer = {}
        end
    end
    
    return real_string_char(...)
end

