        -- Copiar todo
        CopyBtn.MouseButton1Click:Connect(function()
            if #CapturedPayloads > 0 then
                local combined = ""
                for i, payload in ipairs(CapturedPayloads) do
                    combined = combined .. string.format("\n-- PAYLOAD %d [%s] (%d bytes) --\n%s\n", 
