        GUI.PayloadScroll = PayloadScroll
        
        log("✅ GUI creada exitosamente", "SUCCESS")
    end)
    
    if not success then
        log("❌ Error creando GUI: " .. tostring(result), "ERROR")
    end
end

function GUI:UpdateDisplay()
    if not self.Instance or not self.StatsLabel then return end
    
    local statsText = string.format(
        "📊 ESTADÍSTICAS\n" ..
        "Loadstring: %d | Concat: %d | Char: %d\n" ..
        "Bytecode: %d | Source: %d\n" ..
        "💾 Payloads Capturados: %d\n",
        DetectionStats.loadstring_calls,
        DetectionStats.concat_calls,
        DetectionStats.char_calls,
        DetectionStats.bytecode_found,
        DetectionStats.source_found,
        #CapturedPayloads
    )
    
    self.StatsLabel.Text = statsText
    
    -- Actualizar lista de payloads
    if self.PayloadScroll then
        -- Limpiar lista anterior
        for _, child in ipairs(self.PayloadScroll:GetChildren()) do
            if child:IsA("TextButton") then
                child:Destroy()
            end
        end
        
        -- Agregar payloads
        for i, payload in ipairs(CapturedPayloads) do
            local btn = Instance.new("TextButton")
            btn.Size = UDim2.new(1, -10, 0, 30)
            btn.Position = UDim2.new(0, 5, 0, (i-1) * 35)
            btn.BackgroundColor3 = Color3.fromRGB(45, 45, 60)
            btn.BorderSizePixel = 0
            btn.Text = string.format("#%d [%s] - %d bytes", i, payload.type, payload.size)
            btn.TextColor3 = Color3.fromRGB(255, 255, 255)
            btn.TextSize = 11
            btn.Font = Enum.Font.Gotham
            btn.TextXAlignment = Enum.TextXAlignment.Left
            btn.Parent = self.PayloadScroll
            
            btn.MouseButton1Click:Connect(function()
                if save_to_clipboard(payload.content) then
                    btn.Text = "✅ COPIADO - " .. btn.Text
                    task.wait(1.5)
                    btn.Text = string.format("#%d [%s] - %d bytes", i, payload.type, payload.size)
                end
            end)
        end
        
        self.PayloadScroll.CanvasSize = UDim2.new(0, 0, 0, #CapturedPayloads * 35)
    end
end

-- ============================================================================
-- ENTORNO VIRTUAL CON HOOKS
-- ============================================================================
local VirtualEnv = {}

-- Copiar entorno global de forma segura
local success, env = pcall(function()
    return getgenv and getgenv() or _G
end)

if success then
    for k, v in pairs(env) do
        VirtualEnv[k] = v
    end
else
    for k, v in pairs(_G) do
        VirtualEnv[k] = v
    end
end

-- Aplicar hooks
VirtualEnv.loadstring = hook_loadstring
VirtualEnv.load = hook_loadstring

VirtualEnv.table = {}
for k, v in pairs(table) do
    VirtualEnv.table[k] = v
end
VirtualEnv.table.concat = hook_concat

VirtualEnv.string = {}
for k, v in pairs(string) do
    VirtualEnv.string[k] = v
end
VirtualEnv.string.char = hook_char

VirtualEnv.getfenv = function(f)
    if not f or f == 0 then return VirtualEnv end
    return real_getfenv(f)
end

-- ============================================================================
-- EJECUCIÓN PRINCIPAL
-- ============================================================================

log("🔥 Luraph Interceptor V4 iniciado", "INFO")
log("📊 Funciones disponibles:", "INFO")
log("  - setclipboard: " .. (has_setclipboard and "✅" or "❌"), "INFO")
log("  - writefile: " .. (has_writefile and "✅" or "❌"), "INFO")
log("  - game: " .. (has_game and "✅" or "❌"), "INFO")

-- Crear GUI si está disponible
if CONFIG.ShowGUI and has_game then
    task.spawn(function()
        task.wait(0.5)
        GUI:Create()
        task.wait(0.5)
        GUI:UpdateDisplay()
    end)
end

-- Obtener script objetivo
local target_script = ""

if #SCRIPT_IN_TEXT > 50 then
    target_script = SCRIPT_IN_TEXT
    log("📄 Usando script de SCRIPT_IN_TEXT", "INFO")
else
    log("❌ ERROR: Debes pegar el código ofuscado en SCRIPT_IN_TEXT", "ERROR")
    log("📝 Pega el código entre los corchetes dobles [[ ]]", "INFO")
    return
end

log("📊 Tamaño del script: " .. #target_script .. " bytes", "INFO")
log("🚀 Ejecutando script ofuscado...", "INFO")

-- Ejecutar con protección
local func, err = real_loadstring(target_script, "Luraph_Target")

if not func then
    log("❌ Error de sintaxis: " .. tostring(err), "ERROR")
else
    -- Aplicar entorno virtual
    if real_setfenv then
        real_setfenv(func, VirtualEnv)
    end
    
    local success, result = real_pcall(func)
    
    if success then
        log("✅ Script ejecutado correctamente", "SUCCESS")
    else
        log("⚠️ Error en ejecución: " .. tostring(result), "WARN")
    end
end

-- Escaneo final
log("🔍 Escaneando variables residuales...", "INFO")
for k, v in pairs(VirtualEnv) do
    if not _G[k] and type(v) == "string" and #v > 100 then
        local analysis = analyze_payload(v)
        if analysis.confidence > 30 then
            log(string.format("🎯 Variable residual: %s", tostring(k)), "DETECT")
            process_payload(v, "global_" .. tostring(k))
        end
    end
end

-- Actualizar GUI final
task.wait(1)
if GUI.Instance then
    GUI:UpdateDisplay()
end

-- Resumen final
log("", "INFO")
log("═══════════════════════════════════", "INFO")
log("🎉 INTERCEPTOR FINALIZADO", "SUCCESS")
log("📦 Payloads capturados: " .. #CapturedPayloads, "INFO")
log("═══════════════════════════════════", "INFO")

if #CapturedPayloads > 0 then
    log("✅ Se encontraron " .. #CapturedPayloads .. " payloads", "SUCCESS")
    log("💡 Haz clic en los botones de la GUI para copiar", "INFO")
    
    -- Auto-copiar el payload más grande
    if CONFIG.AutoCopy and has_setclipboard then
        local largest = CapturedPayloads[1]
        for _, payload in ipairs(CapturedPayloads) do
            if payload.size > largest.size then
                largest = payload
            end
        end
        save_to_clipboard(largest.content)
        log("📋 Payload más grande copiado automáticamente", "SUCCESS")
    end
else
    log("⚠️ No se detectaron payloads grandes", "WARN")
    log("💡 Posibles causas:", "INFO")
    log("   1. El código no fue pegado en SCRIPT_IN_TEXT", "INFO")
    log("   2. El ofuscador detectó los hooks", "INFO")
    log("   3. El script no ejecuta código dinámico", "INFO")
end
